import React from 'react';
import './checkoutPage.scss'

const CheckoutPage = () => (
    <div className="checkout">
        <div className="checkout-header">
            <div className="header-block">
                <span></span>
            </div>
        </div>
    </div>
)

export default CheckoutPage;
